import React, { useEffect } from "react";
import { connect } from "react-redux";

const GamePage = () => {
  useEffect(() => {}, []);
  return (
    <div className="game-page">
      <div className="game-content"></div>
    </div>
  );
};

const mapStateToProps = (state) => {
  return state;
};

export default connect()(GamePage);
